import React from 'react';

const GalleryManager = () => {
  return (
    <div style={{ padding: 32 }}>
      <h1>Gestión de Galería</h1>
      {/* Aquí irá la subida de fotos y la visualización de fotos en la galería */}
      <p>Aquí podrás subir fotos y ver las fotos de la galería seleccionada.</p>
    </div>
  );
};

export default GalleryManager;
